def solve(lst):
    count = 0
    for i in lst:
        if i == 0:
            count += 1
    for i in range(count):
        lst.remove(0)
        lst.append(0)
    return lst

def solve(lst):
    zeros = []
    non_zeros = []
    for num in lst:
        if num == 0:
            zeros.append(num)
        else:
            non_zeros.append(num)
    return non_zeros + zeros

def solve(nums):
    zeroes = []
    non_zeroes = []
